import React from 'react';
import { useState } from 'react';
import { useIntl } from 'react-intl';

export default function OrdCalculatorList() {
    const intl = useIntl(); 
    const [invoiceNo, setInvoiceNo] = useState("12345678");
    const [elapsed, setElapsed] = useState("8 Days");
    const [commission, setCommission] = useState("৳ 2,700");

    const [currentBalance, setCurrentBalance] = useState("৳30,000");
    const [ord, setORD] = useState("8%");
    const [suggestedPayment, setSuggestedPayment] = useState("৳ 27,300");
    return (
        <>

            <div className='table-responsive p-5'>
                        <table class="table table-borderless">
                            <tbody>
                                <tr>
                                    <td>
                                        <span className='sales-booking-view-table-first-column-sub-title'>{intl.formatMessage({ id: "SALES.RETURN.RETURN_INVOICE_NO" })}</span><br />
                                        <span className='sales-booking-view-table-first-column-title'>{invoiceNo}</span>
                                    </td>
                                    <td>
                                        <span className='sales-booking-view-table-first-column-sub-title'>{intl.formatMessage({ id: "PAYMENT.ORD.CALCULATOR.ELAPSED" })}</span><br />
                                        <span className='sales-booking-view-table-first-column-title'>{elapsed}</span>
                                    </td>
                                    <td>
                                        <span className='sales-booking-view-table-first-column-sub-title'>{intl.formatMessage({ id: "PAYMENT.ORD.CALCULATOR.COMMISSION" })}</span><br />
                                        <span className='sales-booking-view-table-first-column-title'>{commission}</span>
                                    </td>
                                </tr>
                                <tr>
                                    <td>
                                        <span className='sales-booking-view-table-first-column-sub-title'>{intl.formatMessage({ id: "PAYMENT.ORD.CALCULATOR.CURRENT_BALANCE" })}</span><br />
                                        <span className='sales-booking-view-table-first-column-title'>{currentBalance}</span>
                                    </td>
                                    <td>
                                        <span className='sales-booking-view-table-first-column-sub-title'>{intl.formatMessage({ id: "PAYMENT.ORD.CALCULATOR.ORD" })}</span><br />
                                        <span className='sales-booking-view-table-first-column-title'>{ord}</span>
                                    </td>
                                    <td>
                                        <span className='sales-booking-view-table-first-column-sub-title'>{intl.formatMessage({ id: "PAYMENT.ORD.CALCULATOR.SUGGESTED_PAYMENT" })}</span><br />
                                        <span className='sales-booking-view-table-first-column-title'>{suggestedPayment}</span>
                                    </td>
                                </tr>
                            </tbody>
                        </table>
                    </div>


        </>
    );
}
